Features:

- Guide B.O.B through challenges by ROTATING the world around him! 
- Awesome obstacles like wormholes, lasers, ejectors, turbines and much more!
- Freeze ray meter lets you know when you're in danger of icing over. 
- Assist Dr. Cockroach by recovering the spare parts he needs to build useful devices and machinery.
- Earn stars and progress to other hilarious missions. Achieve perfection and you'll be awarded the prestigious Presidential Medal!
- Fun sound effects and original music from the Monsters vs. Aliens movie

